import React from 'react';

import TextLabel from '../UI/TextLabel/TextLabel';

import * as S from './FilmsListStyles';

const FilmsList = ({ films }) => {
  return (
    <>
      <S.Title>Films</S.Title>
      <S.Films>
        {films.map(film => (
          <>
          <TextLabel label="Title" text={film.Title} />
          <TextLabel label="Director" text={film.Director} />
          <TextLabel label="Release Date" text={film.ReleaseDate} />
          </>
        ))}
      </S.Films>
    </>
  );
};

export default FilmsList;
